import React from 'react';
import './App.css';
import Navigation from './Components/Navigation/Navigation.js';
import Logo from './Components/Logo/Logo';
import Url from './Components/Url/Url'
import Rank from './Components/Rank/Rank'

const Particles = {
    polygon: {
        enable: true,
        type: 'inside',
        move: {
            radius: 10
        },
        url: 'path/to/svg.svg'
    }
}

function App() {
  return (
    <div className="App">
      <Particles 
        params={{Particles}} />
      <Navigation />
      <Logo />
      <Rank />
      <Url />
    </div>
  );
}

export default App;
